<script src="{{asset('js/select2.full.min.js')}}"></script>
<script type="text/javascript">

	$(document).ready(function() 
	{
		$('#project-id').select2({
			placeholder: 'Select a project',
			allowClear: true,
			ajax: {
				dataType: 'json',
				url: '{{URL::to('/')}}/search/get_project_id',
				delay: 250,
				data: function(params) {
					return {
						term: params.term
					}
				},
				processResults: function (data, params) {
					params.page = params.page || 1;
					return {
						results: data
					};
				},
			}
		});

		$('#ingo-id').select2({
			placeholder: 'Select a project',
			allowClear: true,
			ajax: {
				dataType: 'json',
				url: '{{URL::to('/')}}/info_maps/get_ingos',
				delay: 250,
				data: function(params) {
					return {
						term: params.term
					}
				},
				processResults: function (data, params) {
					params.page = params.page || 1;
					return {
						results: data
					};
				},
			}
		});

		$('#theme-id').select2({
			placeholder: 'Select an option',
			allowClear: true,
		});

		var default_color = "#D0D2D3";

		var previous_colored_district = [];

		$( "#project-id" ).change(function() {
			
			var project = $('#project-id').val();

			var jqxhr = $.get("{{URL::to('/')}}/info_maps/get_districts", {project_id: project}, function(district_name){

				var object = JSON.parse(district_name);

				color_map(object['districts']);

				$('#dynamic-ul').empty();
				$('#dynamic-paragraph').val("");

				document.getElementById("dynamic-paragraph").innerHTML = "<h2>"+object['project'].project_name+"</h2>";


				$('#dynamic-ul').append('<li>Key partners:'+object['project'].key_partners+'</li>');
				$('#dynamic-ul').append('<li> Start Date: '+object['project'].start_date+'</li>');
				$('#dynamic-ul').append('<li> Theme: '+object['project'].theme+'</li>');
				var url_link = object['project'].url;

				if(url_link !=null){
					$('#dynamic-ul').append('<li> <a  target="_blank" href="'+url_link +'" class="btn btn-round btn-transparent">visit</a> </li>');
				}


			});
		});


		$("#ingo-id").change(function(){

			var ingo_id = $("#ingo-id").val();
			
			

			var jqxhr = $.get("{{URL::to('/')}}/info_maps/get_disticts_for_ingos", {ingo_id: ingo_id}, function(district_name){

				var object = JSON.parse(district_name);
				
				color_map(object['districts']);

				$('#dynamic-ul').empty();
				$('#dynamic-paragraph').val("");

				document.getElementById("dynamic-paragraph").innerHTML = "<h2>About</h2>";

				$('#dynamic-ul').append('<li>'+object['ingo_office']+'</li>');
				

			});

		});

		$("#theme-id").change(function(){

			var theme_id = $("#theme-id").val();

			if(theme_id.length>0){

				var jqxhr = $.get("{{URL::to('/')}}/info_maps/get_district_ by_theme", {theme_id: theme_id}, function(district_name){

					var object = JSON.parse(district_name);

					color_map(object['districts']);

					$('#dynamic-ul').empty();
					$('#dynamic-paragraph').val("");

					document.getElementById("dynamic-paragraph").innerHTML = "<h2>Projects</h2>";

					var project_name = object['project_name'];

					for (var i = 0; i < project_name.length; i++) {
						$('#dynamic-ul').append('<li>Key partners:'+project_name[i]+'</li>');
					}

				});

			}

		});



		function color_map(object){

			if(previous_colored_district.length>0){
				for (var i = 0; i < previous_colored_district.length; i++) {
					$(previous_colored_district[i]).css({fill: "#D0D2D3"});
				}
			}

			previous_colored_district.length = 0;

			for(var i =0; i<object.length; i++){

				previous_colored_district[i] = '#'+object[i];

				$('#'+object[i]).css({ fill: "#41f4f1" });
			}

		}

	});

</script>

